import classes from "./Contact.module.css";

const Contact = () => {
  const Email = () => {
    return (
      <a href="mailto:jogucareers@gmail.com">
        <h3 class={`${classes["email"]} margin-center`}>Email</h3>
      </a>
    );
  };

  return (
    <div className={`${classes["contact"]} ${"container"}`} id="contact">
      <h1>Contact</h1>
      <Email />
    </div>
  );
};

export default Contact;
